import React from "react";
import Header from "./Header.js";
import Footer from "./Footer.js";
import Note from "./Note.js";
import CreateArea from "./CreateArea.js";

function App(){
    return <div>
        <Header />
        <CreateArea />
        <Note key={1} title="Note Title" content="Note Content" />
        <Footer />
    </div>
}

export default App;
